import React from 'react';

class Logo extends React.Component {

    render() {
        return (
            <div className="item">
                <div className="ui tiny image">
                    <img alt="logo" src="favicon.ico" />
                </div>
                <div className="middle aligned content">
                    <p className="header">Youtube TV</p>
                </div>
            </div>
        );
    }
}

export default Logo;
